using FluentAssertions;
using Minio;
using Shopping.Application.Contracts.FileService.Interfaces;
using Shopping.Application.Contracts.FileService.Models;

namespace Shopping.Infrastructure.FileStorage.Minio.Test;

public class MinioFileStorageTest(MinioFileStorageTestSetup setup) : IClassFixture<MinioFileStorageTestSetup>
{
    private readonly IFileService _fileService = setup.FileService;

    private string GetFakeFile()
    {
        return
            @"";
    }
    
    [Fact]
    public async Task Create_Object_With_Valid_Object_Should_Be_Success()
    {

        var saveFileResult = await _fileService.SaveFilesAsync(
            [
                new SaveFileModel(GetFakeFile(), "image/jpg")
            ],
            CancellationToken.None);

        saveFileResult.Should().NotBeNull()
            .And.HaveCountGreaterThan(0);

        saveFileResult[0].FileName.Should().NotBeNullOrEmpty();
        saveFileResult[0].FileType.Should().Be("image/jpg");
    }
    
    [Fact]
    public async Task Getting_Images_Should_Be_Success()
    {
        var saveFileResult = await _fileService.SaveFilesAsync(
            [
                new SaveFileModel(GetFakeFile(), "image/jpg"),
                new SaveFileModel(GetFakeFile(), "image/jpg")
            ],
            CancellationToken.None);

        var filesResult = await _fileService.GetFilesByNameAsync(
            saveFileResult.Select(s => s.FileName).ToList(),
            CancellationToken.None);

        filesResult.Should().HaveCountGreaterThan(0);
        filesResult[0].FileName.Should().NotBeNullOrEmpty();
        filesResult[0].FileType.Should().NotBeNullOrEmpty();
        filesResult[0].FileUrl.Should().NotBeNullOrEmpty();
    }
    
    [Fact]
    public async Task Removing_Image_Should_Be_Success()
    {
        var saveFileResult = await _fileService.SaveFilesAsync(
            [
                new SaveFileModel(GetFakeFile(), "image/jpg"),
                new SaveFileModel(GetFakeFile(), "image/jpg")
            ],
            CancellationToken.None);

        await _fileService.RemoveFileAsync(
            saveFileResult.Select(s => s.FileName).ToArray(), CancellationToken.None);

        var getFileResult = await _fileService.GetFilesByNameAsync(
            [saveFileResult[0].FileName], CancellationToken.None);

        getFileResult.Should().HaveCount(0);
    }
}